import React from "react";
import {Link } from 'react-router-dom';
import style from "./Landing.module.css"
import img from "../IMG/1.jpg";
import img2 from "../IMG/1.2.png";
import img3 from "../IMG/1.3.jpg";


 function Landing() {

  return (
    
    <div className={style.container} > 
    <div className={style.container2}> 
    </div>
          <img className={style.img}  src={img}></img>
     <div>
        
          <img className={style.img3} src={img3} ></img>
 
<img  className={style.img2} src={img2}></img>

      <h1 className={style.texto}>Welcome to World</h1>
     <Link to="/Home">
     <button className={style.button} >aqui vamos al home</button>
     </Link>
     
      </div>
    </div>
  );
}

export default Landing;
